import React, { useEffect, useState } from "react";
import Header from "../common/Header";
import UploadButton from "../common/UploadButton";
import SideNav from "../common/SideNav";
import Sort from "../main/Sort";
import MainWrapper from "../styled/commonStyled/MainWrapper";
import ContentWrapper from "../styled/mainStyled/ContentWrapper";
import HomeWrapper from "../styled/mainStyled/HomeWrapper";
import Upload from "../upload/Upload";
import { Route, Routes, Link } from "react-router-dom";
import SearchUser from "./SearchUser";
import SearchTag from "./SearchTag";
import Content from "../main/Content";
import { useSelector, useDispatch } from "react-redux";
import { getSearch } from "../../redux/module/search";

const SearchResult = () => {
  const [isEmpty, setIsEmpty] = useState(true);
  const keyword = useSelector((state) => state.search.input);
  const results = useSelector((state) => state.search.results);

  useEffect(() => {
    if (results.length != 0) {
      setIsEmpty(false);
    }
    console.log(isEmpty);
  });
  return (
    <HomeWrapper>
      <SideNav />
      <ContentWrapper>
        "{keyword}"에 대한 검색결과입니다.
        <SearchUser />
        <SearchTag />
      </ContentWrapper>
      <UploadButton />
    </HomeWrapper>
  );
};

export default SearchResult;
